import React from 'react';
import AdContainer from '../ads/adContainer';
const MyListings = () => {
  return (
    <div>
      <h3>My Listings</h3>
      <div className='container'>
        <AdContainer/>
      </div>
    </div>
  );
}

export default MyListings;
